import React from 'react';
import Grid from './Grid';

class Game extends React.Component {
	constructor(props) {
		super(props);
		Game.instance = this;
	}

	render() {
		return(
			<div className="game">
				<Grid></Grid>
			</div>
			);
	}
}

export default Game;
